import React from 'react'
import card1 from '../card1.jpg'

export default function Card() {
  return (
    <div>
      <img src={card1} alt="" />
      <div className='details'>
        <i class="fa-solid fa-star"></i>
        <p>5.0 <span> (6). USA</span></p>
      </div>
    </div>
  )
}
